import React from 'react'
import './TopNav.css'

class TopNav extends React.Component {
    render(){
        return(
            <div className="container-fluid">
                <div className="row" style={{padding:'5px', backgroundColor:'black', color:'white'}}>
                    <div className="col-sm-3">LOGO</div>
                    <div className="col-sm-3"></div>
                    <div className="col-sm-3"></div>
                    <div className="col-sm-3"><button align="right" style={{border:'0px', backgroundColor:'transparent'}}>My Profile</button></div>
                </div>
            </div>
        )
    }

}
export default TopNav;
